import Layout from "../components/Layout";
import Form from "../components/Form";
import React from "react";
import Table from "../components/Table";
import Chart from "../components/Chart";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from "react-responsive-carousel";

const api_url =
  "https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan";

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      jsonObjec: null,
      response: null,
    };
  }

  handleSubmit = (laanDetaljer) => {
    this.setState({ jsonObjec: laanDetaljer });
    fetch(api_url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(laanDetaljer),
    })
      .then((res) => res.json())
      .then((result) => {
        this.setState({ response: result });
      });
  };

  render() {
    return (
      <Layout>
        <div>
          <Form handleSubmit={this.handleSubmit} />
        </div>
        <div className="row" style={{marginTop: "3rem"}}>
          <div className="col">
            <button className="btn btn-primary"> Hei</button>
          </div>
        </div>
        <Carousel>
          <div className="row" style={{backgroundColor: "#ffffff"}}>
            <div className="col" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col" style={{ marginTop: 20 }}>
              <Chart response={this.state.response} />
            </div>
          </div>
          <div class="row" style={{backgroundColor: "#ffffff"}}>
            <div className="col" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col" style={{ marginTop: 20 }}>
              <Chart response={this.state.response} />
            </div>
          </div>
          <div class="row" style={{backgroundColor: "#ffffff"}}>
            <div className="col" style={{ marginTop: 20 }}>
              <Table response={this.state.response} />
            </div>
            <div className="col" style={{ marginTop: 20 }}>
              <Chart response={this.state.response} />
            </div>
          </div>
        </Carousel>
      </Layout>
    );
  }
}

export default Index;
